-- Script de creacion de tablas. En este script se crean todas las tablas con sus correspondientes primary key y foreign key. En las dos tablas de hechos las FK se crean con un alter table  y add contraint

CREATE SCHEMA EPH_USO_TECNOLOGIA 
USE EPH_USO_TECNOLOGIA

CREATE TABLE IF NOT EXISTS TIENE_PC (
	ID_TIENE_PC INT NOT NULL AUTO_INCREMENT,
	TIENE_COMPUTADORA VARCHAR(2),
	PRIMARY KEY(ID_TIENE_PC)
    );
    
CREATE TABLE IF NOT EXISTS TIENE_INTERNET (
	ID_TIENE_INTERNET INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    TIENE_INTERNET VARCHAR(2)
    );

CREATE TABLE IF NOT EXISTS REALIZADA (
	ID_ENTREV_REALIZADA INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    REALIZADA VARCHAR(2) NOT NULL
    );
    
CREATE TABLE IF NOT EXISTS TRIMESTRE (
	ID_TRIMESTRE INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	TRIMESTRE VARCHAR(2) NOT NULL
	);

       
CREATE TABLE IF NOT EXISTS AGLOMERADO (
	ID_AGLOMERADO INT NOT NULL PRIMARY KEY,
	AGLOMERADO VARCHAR(100) NOT NULL
	);
        

CREATE TABLE IF NOT EXISTS COMPONENTE (
	ID_COMPONENTE INT NOT NULL PRIMARY KEY,
	CODIGO_COMPONENTE VARCHAR(50) NOT NULL
	);
        
CREATE TABLE IF NOT EXISTS USA_INTERNET (
	ID_USA_INTERNET INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	USA_INTERNET CHAR(2) NOT NULL
    );
    
CREATE TABLE IF NOT EXISTS USA_PC (
	ID_USA_PC INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	USA_PC CHAR(2) NOT NULL
    );


CREATE TABLE IF NOT EXISTS USA_CELULAR (
	ID_USA_CELULAR INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	USA_CELULAR CHAR(2) NOT NULL
    );
        

CREATE TABLE IF NOT EXISTS TABLA_HOGAR (
	CODOSU VARCHAR(29) NOT NULL,
    NRO_HOGAR INT NOT NULL,
    REALIZADA INT NOT NULL,
    ANO4 INT NOT NULL,
    TRIMESTRE INT NOT NULL,
    AGLOMERADO INT NOT NULL,
    POND_TIC INT DEFAULT NULL,
    TIENE_PC INT NOT NULL,
    TIENE_INTERNET INT NOT NULL
    );
    
ALTER TABLE TABLA_HOGAR
		ADD CONSTRAINT FK_ID_TRIMESTRE FOREIGN KEY (TRIMESTRE) REFERENCES TRIMESTRE(ID_TRIMESTRE),
        ADD CONSTRAINT FK_ID_AGLOMERADO FOREIGN KEY (AGLOMERADO) REFERENCES AGLOMERADO(ID_AGLOMERADO),
		ADD CONSTRAINT FK_ID_TIENE_PC  FOREIGN KEY (TIENE_PC) REFERENCES TIENE_PC(ID_TIENE_PC),
		ADD CONSTRAINT FK_ID_TIENE_INTERNET FOREIGN KEY (TIENE_INTERNET) REFERENCES TIENE_INTERNET(ID_TIENE_INTERNET),
        ADD CONSTRAINT FK_REALIZADA FOREIGN KEY (REALIZADA) REFERENCES REALIZADA(ID_ENTREV_REALIZADA);

 
CREATE TABLE IF NOT EXISTS TABLA_PERSONAS (
	CODOSU VARCHAR(29) NOT NULL,
    NRO_HOGAR INT NOT NULL,
    COMPONENTE INT NOT NULL,
    ANO4 INT NOT NULL,
    TRIMESTRE INT NOT NULL,
    AGLOMERADO INT NOT NULL, 
    POND_TIC INT DEFAULT NULL,
    USA_INTERNET INT NOT NULL,
    USA_PC INT NOT NULL,
    USA_CELULAR INT NOT NULL
    );
    
ALTER TABLE TABLA_PERSONAS
	ADD CONSTRAINT FK_ID_TRIMESTRE_ FOREIGN KEY (TRIMESTRE) REFERENCES TRIMESTRE(ID_TRIMESTRE),
    ADD CONSTRAINT FK_ID_AGLOMERADO_ FOREIGN KEY (AGLOMERADO) REFERENCES AGLOMERADO(ID_AGLOMERADO),
    ADD CONSTRAINT FK_ID_USA_INTERNET FOREIGN KEY (USA_INTERNET) REFERENCES USA_INTERNET(ID_USA_INTERNET),
    ADD CONSTRAINT FK_ID_USA_PC FOREIGN KEY (USA_PC) REFERENCES USA_PC(ID_USA_PC),
    ADD CONSTRAINT FK_USA_CELULAR FOREIGN KEY (USA_CELULAR) REFERENCES USA_CELULAR(ID_USA_CELULAR),
    ADD CONSTRAINT FK_COMPONENTE FOREIGN KEY (COMPONENTE) REFERENCES COMPONENTE(ID_COMPONENTE);
    
	

	
	
