-- SCRIPT DE CREACION DE VISTAS


CREATE OR REPLACE VIEW USO_TENENCIA_PC AS
	(SELECT PC.TIENE_COMPUTADORA, UPC.USA_PC, COUNT(*)
	FROM tabla_hogar H
	INNER JOIN tabla_personas P
	ON H.CODOSU = P.CODOSU AND H.NRO_HOGAR = P.NRO_HOGAR
	INNER JOIN tiene_pc PC
	ON PC.ID_TIENE_PC = H.TIENE_PC
	INNER JOIN usa_pc UPC
	ON UPC.ID_USA_PC = P.USA_PC
	GROUP BY PC.TIENE_COMPUTADORA, UPC.USA_PC
	ORDER BY TIENE_COMPUTADORA DESC);
    
SELECT * FROM USO_TENENCIA_PC;
    
CREATE OR REPLACE VIEW USO_TENENCIA_INTERNET AS
	(SELECT I.TIENE_INTERNET, UI.USA_INTERNET, COUNT(*)
	FROM tabla_hogar H
	INNER JOIN tabla_personas P
	ON H.CODOSU = P.CODOSU AND H.NRO_HOGAR = P.NRO_HOGAR
	INNER JOIN tiene_internet I
	ON I.ID_TIENE_INTERNET = H.TIENE_INTERNET
	INNER JOIN usa_internet UI
	ON UI.ID_USA_INTERNET = P.USA_INTERNET
	GROUP BY I.TIENE_INTERNET, UI.USA_INTERNET
	ORDER BY I.TIENE_INTERNET DESC);
    
SELECT * FROM USO_TENENCIA_INTERNET;

CREATE OR REPLACE VIEW DISTRIBUCION AS
	(SELECT  A.AGLOMERADO, COUNT(*)
	FROM tabla_hogar H
	INNER JOIN tabla_personas P
	ON H.CODOSU = P.CODOSU AND H.NRO_HOGAR = P.NRO_HOGAR
	inner join aglomerado A
	ON A.ID_AGLOMERADO = p.AGLOMERADO
	group by p.aglomerado);

SELECT * FROM DISTRIBUCION;

	
	
	
-- SCRIPT DE CREACION DE FUNCIONES

-- dado un id que el campo codosu me indica si el mismo tiene una ponderacion tecnologica mayor o menor al promedio de las personas que tienen y usan pc. 

USE `eph_uso_tecnologia`;
DROP function IF EXISTS `eph_uso_tecnologia`.`ponderacion_hogar`;
;

DELIMITER $$
USE `eph_uso_tecnologia`$$
CREATE DEFINER=`root`@`localhost` FUNCTION `ponderacion_pc`(ID VARCHAR(100)) RETURNS varchar(250) CHARSET utf8mb4
    READS SQL DATA
BEGIN
DECLARE PONDERACION INT;
DECLARE PROMEDIO INT;
DECLARE RESULTADO VARCHAR(255);
	SET PONDERACION = (SELECT TH.POND_TIC 
				FROM tabla_hogar TH
                INNER JOIN tabla_personas TP
                ON TH.CODOSU = TP.CODOSU AND TH.NRO_HOGAR = TP.NRO_HOGAR
                WHERE TH.TIENE_PC = 1 AND USA_PC = 1
				AND ID = TH.CODOSU
                );
	SET PROMEDIO = (SELECT AVG(POND_TIC) FROM tabla_hogar);
    IF PONDERACION > PROMEDIO THEN
		SET RESULTADO = 'este hogar tiene una ponderacion tic MAYOR al promedio para los hogares que tienen y usan PC';
	ELSEIF PONDERACION < PROMEDIO THEN
		SET RESULTADO = 'este hogar tiene una ponderacion tic MENOR al promedio para los hogares que tienen y usan PC';
	ELSE
		SET RESULTADO = 'introdujiste un id incorrecto o  un id que no cumple las condicones';
    END IF;

RETURN RESULTADO;
END$$

DELIMITER ;
;


-- dado un id que el campo codosu me indica si el mismo tiene una ponderacion tecnologica mayor o menor al promedio de las personas que tienen y usan internet. 

USE `eph_uso_tecnologia`;
DROP function IF EXISTS `ponderacion_internet`;

DELIMITER $$
USE `eph_uso_tecnologia`$$
CREATE FUNCTION `ponderacion_internet` (id varchar(60))
RETURNS varchar(250)
reads sql data
BEGIN
DECLARE PONDERACION INT;
DECLARE PROMEDIO INT;
DECLARE RESULTADO VARCHAR(255);
	SET PONDERACION = (SELECT TH.POND_TIC 
				FROM tabla_hogar TH
                INNER JOIN tabla_personas TP
                ON TH.CODOSU = TP.CODOSU AND TH.NRO_HOGAR = TP.NRO_HOGAR
                WHERE TH.TIENE_INTERNET = 1 AND TP.USA_INTERNET = 1
				AND ID = TH.CODOSU
                );
	SET PROMEDIO = (SELECT AVG(POND_TIC) FROM tabla_hogar);
    IF PONDERACION > PROMEDIO THEN
		SET RESULTADO = 'este hogar tiene una ponderacion tic MAYOR al promedio para los hogares que tienen y usan INTERNET';
	ELSEIF PONDERACION < PROMEDIO THEN
		SET RESULTADO = 'este hogar tiene una ponderacion tic MENOR al promedio para los hogares que tienen y usan INTERNET';
	ELSE
		SET RESULTADO = 'introdujiste un id incorrecto o  un id que no cumple las condicones';
    END IF;
RETURN RESULTADO;
END$$

DELIMITER ;

-- CREACION DE STORE PROCEDURE
-- EL MISMO CONSISTE EN ORDENAR LA TABLA PERSONAS DE ACUERDO AL CAMPO QUE LE PASE COMO PARAMETRO. SE MUESTRA DESPUES DE CREAR EL MISMO UN LLAMADO AL STORE PRCEDURE POR EL CAMPO DE ORDENAMIENTO COMPONENTE. 
	
USE `eph_uso_tecnologia`;
DROP procedure IF EXISTS `sp_get_eph`;

USE `eph_uso_tecnologia`;
DROP procedure IF EXISTS `eph_uso_tecnologia`.`sp_get_eph`;
;

DELIMITER $$
USE `eph_uso_tecnologia`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_get_eph`(IN field CHAR(20))
BEGIN
	IF field <> '' THEN
		SET @game_order = concat ('order by ', field );
	ELSE 
		SET @game_order = '';
	END IF;
    SET @clausula = ('SELECT * FROM tabla_personas order by @game_order' );
    PREPARE runSQL FROM @clausula;
    EXECUTE runSQL;
    DEALLOCATE PREPARE runSQL;
END$$

DELIMITER ;
;

call sp_get_eph('COMPONENTE');




	
