-- B) CREO EL RPIMER TRIGGER. EL MISMO VA A INSERTAR EN LA TABLA TR_AFTER_INSERT_HOGAR LOS REGISTROS NUEVOS QUE INSERTE EN TABLA_HOGAR AGREGANDOLE TAMBIEN EL DETALLE
-- DE USUARIO, FECHA, HORA Y TIPO DE MODIFICACION EN ESTE CASO INSERT. 

CREATE TRIGGER `TR_AFTER_INSERT_HOGAR`
AFTER INSERT ON `TABLA_HOGAR` FOR EACH ROW
	CODOSU,
    NRO_HOGAR,
    REALIZADA,
    ANO4,
    TRIMESTRE,
    AGLOMERADO,
    POND_TIC,
    TIENE_PC,
    TIENE_INTERNET,
    USUARIO,
    FECHA,
    HORA,
    TIPO_OPERACION)
VALUES(
	NEW.CODOSU,
    NEW.NRO_HOGAR,
    NEW.REALIZADA,
    NEW.ANO4,
    NEW.TRIMESTRE,
    NEW.AGLOMERADO,
    NEW.POND_TIC,
    NEW.TIENE_PC,
    NEW.TIENE_INTERNET,
    USER(),
    CURDATE(),
    CURTIME(),
    'INSERT');
    
