    USA_INTERNET INT NOT NULL,
    USA_PC INT NOT NULL,
    USA_CELULAR INT NOT NULL,
	USUARIO VARCHAR(255),
    FECHA DATE,
    HORA VARCHAR(255),
    TIPO_OPERACION VARCHAR(255)
    );
    
CREATE TRIGGER `TR_BEFORE_UPDATE_PERSONAS`
BEFORE UPDATE ON `tabla_personas` FOR EACH ROW
	CODOSU			  ,
    NRO_HOGAR         ,
    COMPONENTE        ,
    ANO4              ,
    TRIMESTRE         ,
    AGLOMERADO        ,
    POND_TIC          ,
    USA_INTERNET      ,
    USA_PC            ,
    USA_CELULAR       ,
	USUARIO		    ,
    FECHA             ,
    HORA              ,
    TIPO_OPERACION  )
    VALUES(
	OLD.CODOSU			  ,
    OLD.NRO_HOGAR         ,
    OLD.COMPONENTE        ,
    OLD.ANO4              ,
    OLD.TRIMESTRE         ,
    OLD.AGLOMERADO        ,
    OLD.POND_TIC          ,
    OLD.USA_INTERNET      ,
    OLD.USA_PC            ,
    OLD.USA_CELULAR       ,
	USER()    			  ,
    CURDATE()             ,
    CURTIME()             ,
    'UPDATE'    );

